import React from 'react';
import styled from 'styled-components';

export const Main = styled.div `
  background: #fff;
  padding: 25px 50px;
  margin-bottom: 60px;
  text-align:left
`;

export const MainName = styled.h3 `
  margin: 1.25em 0;
  `;

export const MainText = styled.p `
  display: block;
  margin: 0 0 1.25em;
  line-height: 1.625;
`;
